import { Box, Typography } from '@mui/material';

const OptionTab = ({ items }) => {
    return (
      <div>
        {items.map((item) => (
          <div key={item.id}>
            <h3>{item.title}</h3>
            <p>{item.description}</p>
            {/* Render other item details */}
          </div>
        ))}
      </div>
    );
  };


export default OptionTab;
